import React from "react";

const Matching = (prop) => {
  let x = props.x;
  let y = props.y;
  let z = props.z;
  return (
    <>
      <h1>
        {x} {y} {z}
      </h1>
      <h1> This is Matching :) </h1>
      <hr />
    </>
  );
};

export default Matching;
